class Evento{constructor(id,nombre,url){this.id=id||null,this.nombre=nombre||"",this.url=this.url||""}get List(){var miAccion="ReadAll";$.ajax({type:"POST",url:"class/Evento.php",data:{action:miAccion}}).done(function(e){evento.ShowList(e)}).fail(function(e){evento.showError(e)}).always(function(e){$("#evento").selectpicker("refresh")})}showError(e){var data=JSON.parse(e.responseText);swal({type:"error",title:"Oops...",text:"Algo no está bien ("+data.code+"): "+data.msg,footer:"<a href>Contacte a Soporte Técnico</a>"})}ShowList(e){var data=JSON.parse(e);$.each(data,function(i,item){$("#evento").append(`\n                <option value=${item.id}>${item.nombre}</option>\n            `)}),$("#evento option:contains(Dashboard)").prop("selected",!0),$("#evento option:contains(Dashboard)").attr("disabled",!0),$("#evento").selectpicker("refresh")}}let evento=new Evento;